    return (
        <>
        <StyledTypography variant="h4">Ingresso e pagamento</StyledTypography>
        <SectionSubtitle>Primeiro, escolha sua modalidade de ingresso</SectionSubtitle>
        <div>
            <div>
                <p>Presencial</p>
                <p>R$ 250</p>
            </div>
            <div>
                <p>Online</p>
                <p>R$ 100</p>
            </div>
        </div>
        </>
    );
}

const SectionSubtitle = styled.p`
    font-family: 'Roboto', sans-serif;
    font-weight: 400;
    font-size: 20px;
    line-height: 23.44px;
    color: #8e8e8e;
`
